import React from 'react';
import './App.css';
import Header from './containers/Header';
import Footer from './components/Footer';
import Body from './components/Body';

export default class App extends React.Component {
    render() {
      return (
        <div className="App">
          <Header />
          <Body />
          <Footer />
        </div>
      )
    }
}
